. The lack of transparency and honesty in the beauty industry and online won\u2019t get better until we make a conscious effort to stand for what\u2019s right, TOGETHER!!\n\nIf there's a picture posted by a brand on social media, we deserve to know if it's been retouched or edited. It needs to be mandatory for beauty brands to disclose when they\u2019ve manipulated their images. I\u2019m not asking brands to stop Photoshopping or stop using filters \u2013 I just want brands to communicate when changes have been made to their photos by placing this into their caption: \"This image has been edited or photoshopped.\u201d \n\nI dream of a day when we\u2019re all confident enough to be open about our decisions and we feel better about ourselves knowing the truth behind what actually goes on within the industry! We can help others understand that you can\u2019t compare yourself to an edited picture or another person. Sign the petition today to show your support \u0026 that you also want this change (link in bio) #ownuptoediting"}}]},"edge_media_to_comment":{"count":1062},"comments_disabled":false,"taken_at_timestamp":1615907346,"edge_liked_by":{"count":40861},"edge_media_preview_like":{"count":40861},"location":null,"thumbnail_src":"https://instagram.feoh5-1.fna.fbcdn.net/v/t51.2885-15/sh0.08/e35/c0.420.1080.1080a/s640x640/160513925_873888816489905_2236662824131816124_n.jpg?tp=1\u0026_nc_ht=instagram.feoh5-1.fna.fbcdn.net\u0026_nc_cat=105\u0026_nc_ohc=liElQaAmGQcAX8hxY3X\u0026edm=ABfd0MgAAAAA\u0026ccb=7-4\u0026oh=4435702b4bf89fd6d57c3abf18f4315c\u0026oe=60711A4F\u0026_nc_sid=7bff83","thumbnail_resources":[{"src":"https://instagram.feoh5-1.fna.fbcdn.net/v/t51.2885-15/e35/p150x150/160513925_873888816489905_2236662824131816124_n.jpg?tp=1\u0026_nc_ht=instagram.feoh5-1.fna.fbcdn.net\u0026_nc_cat=105\u0026_nc_ohc=liElQaAmGQcAX8hxY3X\u0026edm=ABfd0MgAAAAA\u0026ccb=7-4\u0026oh=21fb473188702960b7be8cbf8964443c\u0026oe=6070E8B3\u0026_nc_sid=7bff83","config_width":150,"config_height
